Insert Ingests a vector into a specific collection. rpc Insert (InsertRequest) returns (InsertResponse); message InsertRequest { string collection = 1; // Collection name repeated double vector = 2; // Data point uint32 id = 3; // External ID map<string, string> metadata = 4; // Metadata tags DurabilityLevel durability = 7; // Durability override map<string, MetadataValue> typed_metadata = 8; // Typed metadata (int/float/bool/string)
} enum DurabilityLevel { DEFAULT_LEVEL = 0; // Use server config ASYNC = 1; // Flush OS cache (Fastest) BATCH = 2; // Background fsync (Balanced) STRICT = 3; // Fsync every write (High Safety)
} typed_metadata is the preferred metadata path for new clients. Legacy metadata remains for compatibility. Search Finds nearest neighbors. rpc Search (SearchRequest) returns (SearchResponse); message SearchRequest { string collection = 1; repeated double vector = 2; uint32 top_k = 3; // Metadata string filter (e.g. "category:book") map<string, string> filter = 4; // Complex filter object repeated Filter filters = 5; // Hybrid search optional string hybrid_query = 6; optional float hybrid_alpha = 7;
} SearchResult now includes both metadata and typed_metadata. SearchBatch Finds nearest neighbors for multiple queries in a single RPC call. rpc SearchBatch (BatchSearchRequest) returns (BatchSearchResponse); message BatchSearchRequest { repeated SearchRequest searches = 1;
} message BatchSearchResponse { repeated SearchResponse responses = 1;
} Recommended for high-concurrency clients and benchmarks to reduce per-request gRPC overhead. SubscribeToEvents Streams CDC events for post-insert/delete hooks. rpc SubscribeToEvents (EventSubscriptionRequest) returns (stream EventMessage); enum EventType { EVENT_UNKNOWN = 0; VECTOR_INSERTED = 1; VECTOR_DELETED = 2;
} message EventSubscriptionRequest { repeated EventType types = 1; optional string collection = 2;
} message EventMessage { EventType type = 1; oneof payload { VectorInsertedEvent vector_inserted = 2; VectorDeletedEvent vector_deleted = 3; }
} Use this stream to build external pipelines (audit, Elasticsearch sync, graph projections, Neo4j updaters). MetadataValue (Typed Metadata) message MetadataValue { oneof kind { string string_value = 1; int64 int_value = 2; double double_value = 3; bool bool_value = 4; }
} Graph Traversal API (v2.3) rpc GetNode (GetNodeRequest) returns (GraphNode);
rpc GetNeighbors (GetNeighborsRequest) returns (GetNeighborsResponse);
rpc GetConceptParents (GetConceptParentsRequest) returns (GetConceptParentsResponse);
rpc Traverse (TraverseRequest) returns (TraverseResponse);
rpc FindSemanticClusters (FindSemanticClustersRequest) returns (FindSemanticClustersResponse); Key safety guards: GetNeighborsRequest.limit and offset for bounded pagination. TraverseRequest.max_depth and max_nodes to prevent unbounded graph walks. FindSemanticClustersRequest.max_clusters and max_nodes for bounded connected-component scans. TraverseRequest is filter-aware and supports both: filter (map<string,string>) filters (Match / Range)

